@import url("https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css");
@import url("https://fonts.googleapis.com/css?family=Roboto&display=swap");

//Set up variables
$font: "Roboto Condensed", sans-serif;
$offBlack: #2d2d2d;
$offWhite: #f5f5f5;

@mixin title-font {
  $font: $font;
  letter-spacing: 3px;
  text-transform: uppercase;
  color: $offWhite;
  font-weight: 200;
  margin-right: 15px;
}

//Customise theme colors
$theme-colors: (
  "primary": #0074d9,
  "danger": #ff4136,
  "dark": $offBlack,
);

$brand-dark: #2d2d2d;

//Custom Bootstrap
.navbar {
  background: $offBlack;
  color: $offWhite;
}

.dark {
  background: $offBlack;
}

.dark-text {
  @include title-font();
  color: $offBlack;
}

.dark-text-p {
  color: $offBlack;
  font-weight: 300;
}

.light-text {
  @include title-font();
  font-size: 12px;
}

.light-text-title {
  @include title-font();
  font-size: 20px;
  margin-top: -50px;
  margin-bottom: 30px;
}

.nav-item {
  @include title-font();
}

.social-icon {
  font-size: 24px;
  margin-top: -2px;
}

.bg-grey {
  background: $offBlack;
}

//My styles
body {
  font-family: $font;
  overflow-x: hidden;
  position: relative;
  padding-top: 50px;
  background: $offBlack;
  color: $offWhite;
}

html {
  overflow-x: hidden;
}

.mm-logo {
  width: 500px;
}

.nav-logo-img {
  height: 35px;
}

.video-card {
  border: 0;
}

.nav-link:hover {
  cursor: pointer;
}

.offer-container {
  margin-bottom: 120px;
}

.top-video {
  margin-top: 0px;
  width: 110%;
  object-fit: cover;
  height: 550px;
}

.highlight-card,
.modal-bg {
  background: $offWhite;
}

.highlight-card:hover {
  -webkit-animation: pulsate-fwd 0.8s ease-in-out both;
  animation: pulsate-fwd 0.8s ease-in-out both;
}

.btn-gry:hover {
  opacity: 0.9;
  color: $offWhite;
}

.blockquote {
  font-weight: 300;
  color: $offWhite;
}

.page-footer {
  margin-top: 80px;
}

.carousel-inner {
  height: 30vh;
  font: $font;
  color: $offWhite;
}
.carousel-caption {
  color: $offWhite;
  top: 50%;
}

.carousel-caption h3 {
  @include title-font();
  font-size: 16px;
  text-transform: unset;
}

.carousel-caption p {
  @include title-font();
  font-size: 14px;
  opacity: 0.9;
  margin-top: 15px;
}

.jumbo-video {
  padding: 0;
  background: $offBlack;
  margin-bottom: 130px;
}

.jumbo-video video {
  width: 100%;
}

.jumbo-video p {
  @include title-font();
  font-size: 20px;
  padding-right: 200px;
  margin-top: 20px;
  text-align: center;

  position: absolute;
  width: 100%;
}

form label {
  @include title-font();
  font-size: 12px;
}

form input {
  letter-spacing: 2px;
}

.btn-light {
  @include title-font();
  color: $offBlack;
  margin-right: 0px;
}

